import {GoogleMap, InfoWindow, Marker, GoogleApiWrapper} from 'google-maps-react';
import React, {Component} from 'react';

export class MapContainer extends Component {
  render() {
    return (
    <GoogleMap style={{width:this.props.width, overflow: 'hidden'}} defaultOptions={{
      disableDefaultUI: true, // disable default map UI
      draggable: true, // make map draggable
      keyboardShortcuts: false, // disable keyboard shortcuts
      scaleControl: true, // allow scale controle
      scrollwheel: true, // allow scroll wheel
      styles: style // change default map styles
    }} google={this.props.google} zoom={14}></GoogleMap>

    );
  }
}

